import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <Header/>
      <h1>Este es mi primer componente</h1>

      <img src='https://computacioninteractiva.com/wp-content/uploads/2019/11/Tecnolog%C3%ADa-digital-01.png'></img>
      <Footer/>
    </div>
  );
}

export default App;
